        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3023278241":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"showCoverPage\":false,\"bookCover\":{\"coverDescription\":\"<p style=\\\"text-align:center\\\"></p>\"},\"chapters\":[{\"params\":{\"content\":[{\"content\":{\"params\":{\"text\":\"<h3>Voraussetzungen für die Entstehung von Wellen</h3><p>Die Ausbreitung mechanischer Wellen erfordert zuerst einmal einen <strong>Träger</strong>, in dem sich schwingungsfähige Teilchen befinden.  Träger können dabei feste, flüssige oder gasförmige Körper sein.</p><p>Elektromagnetische Wellen brauchen keinen Träger, sie können sich auch im <strong>Vakuum</strong> ausbreiten (Licht von der Sonne zur Erde). </p><p>Bei den mechanischen Wellen müssen die Träger schwingungsfähige Teilchen sein, die untereinander eine <strong>Kopplung</strong> aufweisen. So kann sich die von außen einwirkende Störung über das System fortpflanzen.</p><p>Zur Veranschaulichung dieser Kopplung arbeitet man oft mit dem sogenannten Kugel-Feder-Modell. Die Kugeln symbolisieren die schwingungsfähigen Teilchen, die Federn deuten auf die Kopplung zwischen den Teilchen hin. Der Einfachheit halber zeichnet man statt der Federn häufig nur Striche zwischen den Teilchen.</p>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2a5c485c-bb52-4acf-8720-dc97937d62e2\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAoQAAADACAYAAACd4XIcAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAHYcAAB2HAY/l8WUAADKnSURBVHhe7d1Xcx1ngub5f+bx8N4QoDeSKNFIlCFF et sich die Störung schrittweise im gesamten System aus.</p><p>Die Ausbreitungsgeschwindigkeit hängt von der Elastizität der Kopplung und der Trägheit der Teilchen ab: Sie steigt mit stärkerer elastischer Kopplung und sinkt mit größerer Masse der Teilchen. In der Regel ist sie eine Eigenschaft des Systems selbst und unabhängig von Art, Stärke oder Frequenz der Anregung.</p><p>Wird ein Teilchen zu einer Sinusschwingung angeregt, entsteht eine harmonische Welle.</p><p>Bei einer mechanischen Welle breitet sich <strong>nicht Materie</strong>, sondern der <strong>Bewegungszustand</strong> der Teilchen aus: Die Teilchen schwingen um ihre Gleichgewichtslage, bleiben aber im Mittel am selben Ort. Es wird Energie transportiert, jedoch keine Materie.</p><h3>Energieformen in Wellen</h3><p><span style=\\\"background-color:rgb(255,255,255);color:rgb(0,0,0)\\\">Beginnend mit dem Erreger verrichtet jedes Teilchen beim Übertragen der Störung über die Kopplung am nächsten Teilchen zunächst Beschleunigungs- und schließlich Spannarbeit. Mit dem Verrichten dieser Arbeit ist somit Energieübertragung von einem Teilchen zum nächsten verbunden. Mit der Störung wandern also Spann- und Kinetische Energie durch das System. Die Energien stecken jeweils in denjenigen Teilchen des Systems, die gerade von der Störung erfasst sind. Die Welle überträgt damit sowohl Energie als auch Impuls vom Erreger durch das System. </span></p><h3>Wellenfronten und Wellenstrahlen</h3><p>Zwischen der erzwungenen Schwingung an einer bestimmten Stelle des Wellenfeldes und der Schwingung des Erregers besteht eine Phasendifferenz. Alle Punkte, die gleich weit vom Erregerzentrum entfernt sind, schwingen in Phase.</p><p>Benachbarte Punkte gleicher Phase bilden die sogenannte <strong>Wellenfront</strong>.</p><p>Senkrecht zu den Wellenfronten verlaufen die <strong>Wellennormalen</strong> (man nennt sie auch <strong>Wellenstrahlen</strong>), welche die Ausbreitungsrichtung der Welle angeben.</p>\"},\"library\":\"H5P.Advanc .1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a7bc0728-a772-4143-80ae-518e5dbabfcf\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"linkWidget\":{\"protocol\":\"https://\",\"url\":\"vimeo.com/910002094?fl=pl&amp;fe=sh\"},\"title\":\"Longitudinalwellen\"},\"library\":\"H5P.Link 1.3\",\"metadata\":{\"contentType\":\"Link\"},\"subContentId\":\"0adaedc3-b0f6-4d0e-b754-c8200cda044a\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"linkWidget\":{\"protocol\":\"https://\",\"url\":\"vimeo.com/910001937?fl=pl&amp;fe=sh\"},\"title\":\"Transversakwellen\"},\"library\":\"H5P.Link 1.3\",\"metadata\":{\"contentType\":\"Link\"},\"subContentId\":\"0d704ae5-8066-46c0-ae83-2b195c2a85f6\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3>Wasserwellen</h3><p>Auf den ersten Blick könnte man meinen, dass Wasserwellen sich wie die oben beschriebenen Transversalwellen verhalten. Das ist aber nicht so!</p><p>Die Wasserteilchen am Boden bewegen sich fast gar nicht. Je näher sich die Wasserteilchen an der Wasseroberfläche befinden, desto stärker bewegen sie sich, und zwar auf Kreisbahnen mit festen Mittelpunkten. </p><p><span style=\\\"background-color:rgb(255,255,255);color:rgb(0,0,0)\\\">Du kannst deutlich beobachten, dass bei einer Wasserwelle Wellenberg und Wellental nicht dieselbe Form haben: Der Wellenberg ist kürzer und steiler als das Wellental.</span></p><p> </p><p><span style=\\\"background-color:rgb(255,255,255);color:rgb(0,0,0)\\\">Schau dir hierfür den Link an:</span></p>\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"86a12a52-6066-4e85-82dd-5098d31312a1\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"linkWidget\":{\"protocol\":\"https://\",\"url\":\"vimeo.com/910001687?fl=pl&amp;fe=sh\"},\"title\":\"Wasserwellen\"},
